(19, 'terms_and_conditions', '<h1><span dir=\"rtl\"><span class=\"marker\"><ins><strong>الشروط والأحكام</strong></ins></span></span></h1>\r\n\r\n<hr />\r\n<h1><span dir=\"rtl\"><img alt=\"وصللي™\" src=\"http://wassalley.com/storage/app/public/restaurant/2022-01-14-61e1ef09e41bd.png\" style=\"height:420px; width:420px\" /></span></h1>\r\n\r\n<hr />\r\n<h2><span dir=\"rtl\"><strong>1- </strong><strong>تطبيق وصللي</strong>&trade;<strong> Wassalley</strong>&trade;<strong> يعمل كوسيط بين العميل والمطاعم المتنوعة بالتعاون مع شركاء النجاح المنضمين معنا بالتطبيق و نتطلع أن نقدم خدمة مميزة لعملائنا الكرام الذين سوف نسعد بإنضمامهم لنا من خلال إستخدام تطبيقنا ونتمنى أن تحظى خدمتنا &nbsp;على قبول وإستحسان عملائنا الكرام و نعدكم بأننا سوف نبذل قصارى جهدنا لضمان توصيل وتسليم طلباتكم بالسرعة الممكنة ، ونرجوا العذر إذا حصل أي تأخير غير مقصود في وصول طلباتكم لظروف قد تكون خارجة عن إرادتنا مثل العوامل الجوية لذا لزم التنويه بأن وقت التسليم للظروف سالفة الذكر لن يكون ثابتاً مع مراعاتنا بأن نصل في الوقت المحدد . &nbsp;</strong></span></h2>\r\n\r\n<h2><span dir=\"rtl\"><strong>2- أن الهدف من خدماتنا هو تقديم خدمة مرنة و مريحة من خلال التواصل بالشركاء وتقديم أفضل المنتجات والعروض و ضمان توصيل وتسليم المنتجات إليكم وهي في أفضل حال ، واما اذا كان موقعك خارج محيط التسليم فسوف نشعرك برسالة إلكترونية لإبلاغك ان طلبك عبر الإنترنت متعذر ، كما نود إحاطتك بأن ساعات العمل ستكون متاحة حسب ظروف التداول المحلية و جاهزية شريكنا .</strong></span></h2>\r\n\r\n<h2><span dir=\"rtl\"><strong>3- عند طلبك من خلال تطبيق وصللي</strong>&trade;<strong> سيتم بعث رسالة شكر و ترحيب لك عبر بريدك الإلكتروني وتأكيد قبول طلبك ، لذا نأمل أن تقدم لنا بريدك الإلكتروني صحيحاً للتواصل معك بشأن طلبك كما نأمل أن تقوم بتذويدنا بعنوانك و رقم هاتفك لكي يتم توصيل طلبك إلى موقعك الصحيح ، كما نود أن نلفت نظرك أنه في حالة عدم الرد على هاتفك في مدة أقصاها خمسة دقائق من أتصال سائق التوصيل التابع لنا بك فأنه يحق للسائق مغادرة موقعك مع احتفاظنا بحقنا في المطالبة بقيمة الطلب ، لذا نرجوا منك المساعدة و التعاون من أجل تقديم خدمة أفضل لك وفي الوقت المحدد . &nbsp;</strong></span></h2>\r\n\r\n<h2><span dir=\"rtl\"><strong>4- عميلنا العزيز يحق لك القيام بإلغاء طلبك في مدة زمنية محددة قبل قيام الشريك بتجهيزه ويصبح الطلب حيز التنفيذ ، لذا عليك التواصل بنا و مع الشريك وسيكون ذلك مجاناً دون رسوم أما اذا تم إلغاء الطلب من قبل الشريك فسوف يتم إشعارك فوراً بذلك مع إيضاح سبب الإلغاء ولن تكون هناك رسوم عليك مقابل الإلغاء و سيتم إعادة مبلغ تلك العملية لحسابك خلال خمسة أيام عمل مع ملاحظة أن أي طلب تم إلغاؤه بعد تجهيزه فأنه يتم تحصيل رسوم منك لقاء ذلك وسوف يحدد من قبل وصللي</strong>&trade;<strong> حيث نقوم بتحديد ما اذا كان الطلب نفذ أم لم ينفذ بعد و سنقوم بإرجاع كامل مبلغ العملية أو جزء منه حسب ما يراه &quot;وصللي </strong>&trade;<strong>&quot; وسيكون ذلك نقدا أو كرصيد على وصللي</strong>&trade;<strong>&nbsp;كما يرجى إشعارنا في حال كان السداد بالبطاقة الإتمانية وسوف يعاد المبلغ للبطاقة في مدة اقصاها خمسة أيام عمل حسب أنظمتنا وأنظمة البنك مصدر البطاقة .</strong></span></h2>\r\n\r\n<h2><span dir=\"rtl\"><strong>5- يجب أن يكون في الحسبان بأن الأسعار قد تتغير في أي وقت ولكن نضمن لك بأن تلك التغيرات لن تؤثر على الطلبات التي تم تأكيدها مسبقاً عبر البريد الإلكتروني ، كما نود الإيضاح بأنه قد يتم تسعير بعض الطلبات المبينة في التطبيق بشكل غير صحيح وللشريك المعني التحقق من تلك الأسعار أثناء عملية الطلب ، أن إجراء الدفع لطلباتك تكون نقدا عند الإستلام أو الدفع من خلال بطاقة الإئتمان وسوف نتولى الدفع مباشرة إلى الشريك ، كما نود ملاحظة أن رسوم الخدمة قد تتغير في أي وقت بالزيادة أو التخفيض .</strong></span></h2>\r\n\r\n<h2><span dir=\"rtl\"><strong>6- تستخدم جميع الكوبونات لمرة واحدة فقط وخلال فترة صلاحيتها وعلى الأطعمة فقط ويسري ذلك على جميع المطاعم مالم ينص على خلاف ذلك ولا تشمل الكوبونات رسوم خدمة التوصيل ما لم ينص على خلاف ذلك ولا يمكن استبدال تلك الكوبونات بالنقد أو الإئتمان كما لا يمكن إعادة بيع تلك الكوبونات ولا يمكن استعادة أو استرداد الطلبات التى تم إلغائها والمسددة بإستخدام الكوبونات بغية الحصول على النقد أو الإئتمان .</strong></span></h2>\r\n\r\n<h2><span dir=\"rtl\"><strong>7- تحفظ بيانات مستخدم بطاقة الخصم المباشر العائدة للمستخدم و تخزن على جهازه بصفة مؤقتة ثم يكون له الحق في قبول أو رفض حفظ تلك البيانات علماً بأنه سيتم تحديث تلك البيانات المخزنة تلقائياً لفترة وجيزة و يمكن للمستخدم تفعيل أو تعطيل أو مسح تلك البيانات من خلال إعداد ملف التعريف الخاص بالمستخدم و يكون الحفظ على مسؤلية المستخدم الشخصية ولا يحق له فيما بعد الإعتراض أو المطالبة أو القيام بإتخاذ أي إجراء قانوني ضد شركة وصللي</strong>&trade;<strong> أو منسوبيها أو ممثليها أو وكلائها أو أي شركات أو كيانات تابعة لها فيما يخص سرقة&nbsp;تلك البيانات أو العبث بها أو استغلالها بطريقة سيئة ويعتبر هذا إقرار منك بالموافقة على ماجاء أعلاه ولن تتحمل وصللي</strong>&trade;<strong> أو أي شريك أي مسؤلية قانونية حيال أي خسائر أو اضرار مباشرة أو غير مباشرة أو خاصة أو تبعية تنشأ في العقد أو بسبب المسؤلية التقصيرية بسبب الإهمال أو سوء إستخدامك أو عدم معرفة بتطبيق وصللي</strong>&trade;<strong> </strong></span></h2>\r\n\r\n<h2><span dir=\"rtl\"><strong>8- أن وصللي</strong>&trade;<strong> يعمل كوسيط بين العميل و المطاعم المختلفة المسجلين معنا في التطبيق و مقابل ذلك يحصل وصللي</strong>&trade;<strong> على رسوم خدمة التوصيل ، وليست شركة &quot;وصللي</strong>&trade;<strong>&quot; مسؤلة عن جودة تلك المنتجات &quot;الأطعمة&quot; وتقع مسؤلية ذلك على الشريك &quot;المطعم&quot; و طالب الخدمة لذا ينصح بضرورة التواصل مع الشريك &quot;المطعم&quot; قبل الطلب لمعرفة الإطعمة المناسبة صحياً لك ومن ثم البدء بالطلب ، أي نزاعات أو مطالبات لا قدر الله قد تنشأ بين مستخدمي التطبيق و شركة &quot;وصللي</strong>&trade;<strong>&quot; يجب أن تخضع للأنظمة والقوانين المحلية بجمهورية مصر العربية وتكون المحاكم المحلية المختصة بمدينة الإسماعيلية&nbsp;هي صاحبة الإختصاص القضائي بالنظر في تلك النزاعات أو المطالبات أو التسويات،&nbsp;</strong></span></h2>\r\n\r\n<h2><span dir=\"rtl\"><strong>9- لا يجوز أن يستخدم هذا التطبيق الا للخدمات التي أنشأ من أجله و لا يحق استخدام أو إعادة استخدام أو تحميل و تنزيل أي من محتوى التطبيق دون إذن منا حيث أن شركة &quot;وصللي</strong>&trade;<strong>&quot; المالكة حصرياً للتطبيق و أن جميع حقوق الملكية الفكرية في موقعنا هي ملك للشركة بموجب القانون .</strong></span></h2>\r\n\r\n<h2><span dir=\"rtl\"><strong>10- بإستخدامك لتطبيق وصللي</strong>&trade;<strong> تكون قد وافقت على كافة الشروط والأحكام سالفة الذكر&nbsp;.</strong></span></h2>', NULL, '2022-01-18 19:18:39'),
