(39, 'privacy_policy', '<h2 style=\"font-style:italic\"><ins><big><span class=\"marker\"><strong>سياسة الخصوصية</strong></span></big></ins></h2>\r\n\r\n<h1><img alt=\"وصللي™ wassaley™\" src=\"http://wassalley.com/storage/app/public/restaurant/2022-01-14-61e1ef09e41bd.png\" style=\"height:420px; width:420px\" /></h1>\r\n\r\n<h1><strong><span class=\"marker\"><span dir=\"rtl\">تطبيق وصللي&trade; المملوك لشركة&nbsp;وصللي للتكنولوجيا والخدمات</span></span></strong></h1>\r\n\r\n<p><span dir=\"rtl\">(يشار إليها مجتمعة بـ&quot;<strong>وصللي</strong>&trade;&quot;،&quot;<strong>نحن</strong>&quot;)</span></p>\r\n\r\n<p><span dir=\"rtl\">تجمع معلومات عنك عند استخدامك لتطبيق وصللي&trade; للهاتف المحمول الخاص بنا والمواقع الإلكترونية&nbsp;ومركز خدمة العملاء&nbsp;(يشار إليهم مجتمعين بـ&quot;الخدمات&quot;) عند استخدامك لتطبيق وصللي&trade; وخدمة العملاء ومن خلال التفاعلات والاتصالات الأخرى الخاصة بك معنا. تنص سياسة الخصوصية هذه على الأساس الذى سوف تعتمد عليه حالاً فى معالجة المعلومات بما فى ذلك البيانات الشخصية التى نجمعها منك أو تضيفها أنت لبياناتك. فى كل مرة تدخل فيها أو تستخدم الخدمات أو تزودنا بمعلومات عنك، فإنك بقيامك بذلك تقبل وتوافق على الممارسات المبينة فى سياسة الخصوصية التالية.</span></p>\r\n\r\n<h1><span dir=\"rtl\"><strong>النطاق والتطبيق</strong></span></h1>\r\n\r\n<ol>\r\n	<li><span dir=\"rtl\">تنطبق سياسة الخصوصية على الأشخاص فى أى مكان فى العالم؛ الذين يدخلون ويستخدمون الخدمات الخاصة بنا (يشار إليهم في هذه السياسة بـ&quot;المستخدمين&quot;) فضلاً عن سائقي المركبات (توك توك، موتوسيكل، تروسيكل، أو أي مركبات اخرى) أو أشخاص آخرين يستخدموا نظام وصللي&trade; بموجب تعاقد (يشار إليهم مجتمعين بـ&quot;السائق&quot;).</span></li>\r\n</ol>\r\n\r\n<h1><span dir=\"rtl\"><strong>جمع البيانات</strong></span></h1>\r\n\r\n<h2><span dir=\"rtl\">البيانات التى تشاركها معنا</span></h2>\r\n\r\n<ol>\r\n	<li><span dir=\"rtl\">يقوم وصللي&trade; بجمع بياناتك التى تشاركها معنا مباشرة من خلال اتصالك أو استخدامك لأي من خدماتنا أو تطبيقاتنا، على سبيل المثال: عندما تقوم بإنشاء أو تعديل الحساب الخاص بك، طلب خدمات حسب الطلب، الاتصال بالدعم الفني أو خدمة العملاء، أو الاتصال بنا بطرق أخرى. قد تتضمن هذه المعلومات: اسمك، بريدك الالكتروني، رقم هاتفك الخلوي (الموبايل)، عنوان البريد الإلكتروني، صورة الملف الشخصي، طريقة الدفع، والبيانات المالية ومعلومات بطاقة الائتمان، وأي معلومات أخرى تختار مشاركتها معنا.</span></li>\r\n	<li><span dir=\"rtl\">الرجاء العلم بأننا لا نتعمد جمع البيانات الشخصية من الأطفال ما دون سن 18 أو الاحتفاظ بها أو حفظها من خلال خدماتنا أو تطبيقاتنا، حيث أننا نطلب بأن يتعهد كل مستخدم بأن عمره لا يقل عن 18 سنة.</span></li>\r\n</ol>\r\n\r\n<h2><span dir=\"rtl\">بيانات نجمعها من خلال استخدامك لخدماتنا</span></h2>\r\n\r\n<ol>\r\n	<li><span dir=\"rtl\">عندما تقوم باستخدام خدماتنا، نقوم بجمع معلومات (يمكن استخدامها للأتصال بك مباشرة مثل الاسم الكامل والعنوان البريدي ورقم الهاتف ومعلومات بطاقة الائتمان، البرومو كود أو كود الخصم، أو عنوان البريد الالكترونى) (&quot;البيانات الشخصية&quot;) و البيانات الديمغرافية (أى البيانات غير الشخصية التي تشاركها معنا، يشمل ذلك، على سبيل المثال لا الحصر، الرمز البريدى، بلدك، الجنس، اسم المستخدم، بيانات نظام التشغيل الذي تستخدمه، يشمل ذلك نوع جهاز الهاتف الخلوي الذى تستخدمه، بيانات تعريف جهازك (على سبيل المثال رقم الجهاز الخاص بك، عنوان المالك لواجهة الشبكة اللاسلكية للجهاز، أو رقم الهاتف المحمول المستخدم بواسطة الجهاز)، معلومات IMEI&nbsp;&nbsp;شبكة الهاتف الخلوي، نظام تشغيل الهاتف، نوع متصفح الهاتف المحمول الذى تستخدمه، إعدادات المنطقة الزمنية، موقع الجهاز، موقعك، بيانات الرسائل القصيرة، بيانات التعاملات، العمر، تاريخ الميلاد، معلومات سجل التصفح، معلومات سجل البحث IP بروتوكول. ومعلومات سجل التسجيل (&quot; البيانات الديمغرافية &quot;، إلى جانب البيانات الشخصية&quot;)، البيانات الشخصية لتحديد موقعك الحالى. بعض الخدمات الخاصة بنا التى تمكن من تحديد موقعك تطلب بيانات (GPS) كما نستخدم أيضًا تقنية نظام تحديد المواقع الشخصية للعمل فى المستقبل. إذا كنت ترغب بأستخدام خاصية معينة، سوف يطلب منك الموافقة على البيانات التى يجرى استخدامها لهذا الغرض.</span></li>\r\n</ol>\r\n\r\n<h2><span dir=\"rtl\">بيانات نجمعها من مصادر أخرى</span></h2>\r\n\r\n<p><span dir=\"rtl\">يمكننا استخدام البيانات الشخصية التى تزودنا بها ونجمعها منك للأغراض التالية:&nbsp;</span></p>\r\n\r\n<ol>\r\n	<li><span dir=\"rtl\">ربما نحصل على معلومات أيضًا من مصادر أخرى وندمجها مع المعلومات الشخصية التى شاركتها معنا أو جمعناها من خلال خدماتنا على سبيل المثال: إذا أخترت ربط، إنشاء، أو تسجيل الدخول إلى حساب وصللي&trade; الخاص بك مع مزود خدمات الدفع أو خدمة وسيلة تواصل اجتماعية (على سبيل المثال&nbsp;&nbsp;فيسبوك) أو إذا كنت تتواصل من خلال تطبيق أو موقع منفصل يستخدم واجهة معالجة التطبيق الخاصة بنا (أو واجهة معالجة التطبيق التى نستخدمها)، يمكننا الحصول على معلومات عنك أو عن اتصالاتك من ذلك الموقع أو التطبيق.</span></li>\r\n	<li><span dir=\"rtl\">إذا كانت جهة العمل الخاصة بك تستخدم واحدًا من الحلول المؤسسية&nbsp;الخاصة بنا، قد نحصل على بياناتك من جهة العمل الخاصة بك.</span></li>\r\n	<li><span dir=\"rtl\">عندما تطلب خدمات التوصيل بالطلب، يجوز للسائق التابع لنا تزويدنا بتقييم للمستخدم بعد تقديم الخدمات لك، إذا كنت تتفاعل أيضًا مع خدماتنا بصفة أخرى، على سبيل المثال كسائق، ربما نقوم بدمج وربط هذه البيانات بالبيانات الشخصية التي شاركتها معنا بصفتك مستخدم أو راكب.</span></li>\r\n</ol>\r\n\r\n<h2><span dir=\"rtl\">استخدام البيانات الشخصية</span></h2>\r\n\r\n<p><span dir=\"rtl\">يمكننا استخدام البيانات الشخصية التى تزودنا بها ونجمعها منك للأغراض التالية:&nbsp;</span></p>\r\n\r\n<ol>\r\n	<li><span dir=\"rtl\"><strong>تطوير، صيانة، وتحسين خدماتنا</strong>، يشمل ذلك على سبيل المثال: تسهيلات الدفع وإرسال الإيصالات وتقديم المنتجات والخدمات التى تطلبها (و إرسال معلومات ذات صلة)، تطوير ميزات جديدة وتقديم الدعم الفني وخدمة العملاء للمستخدمين والكابتن، تطوير مميزات الأمان، منح الإذن للمستخدمين، إرسال ترقيات وتحديثات المنتج، والرسائل الإدارية والإجرائية.</span></li>\r\n	<li><span dir=\"rtl\"><strong>إدارة أداء العمليات الداخلية</strong>، يشمل ذلك على سبيل المثال، منع الاحتيال وإساءة استخدام خدماتنا، استكشاف أخطاء البرمجيات وحلولها والمشاكل التشغيلية.</span></li>\r\n	<li><span dir=\"rtl\"><strong>اختبار، بحث، مراقبة، وتحليل بيانات</strong>&nbsp;ومؤشرات الاستخدام والنشاط بينك وبين الآخرين (مستخدمين أو سائقين).</span></li>\r\n	<li><span dir=\"rtl\"><strong>تسهيل الإتصال بينك وبين السائق</strong>، مثل أثناء الأوقات المقدرة للوصول، أو عند طلب مركبة.</span></li>\r\n	<li><span dir=\"rtl\"><strong>إرسال وتسهيل الاتصال بينك وبين الآخرين،</strong>&nbsp;مثل العروض، الخصومات، وأكواد الخصم على المنتجات.</span></li>\r\n	<li><span dir=\"rtl\"><strong>إرسال معلومات لك قد تهمك</strong>، مثل العروض، أكواد الخصم على الخدمات، عروض وصللي&trade;، الأخبار والتحديثات الخاصة بوصللي&trade; أو أي من خدماتها. ويتم ذلك طبقًا للمسموح والقوانين المحلية المعمول بها.</span></li>\r\n	<li><span dir=\"rtl\"><strong>إشعارك بشأن تغييرات</strong>&nbsp;أو تطورات في خدماتنا.</span></li>\r\n	<li><span dir=\"rtl\"><strong>السماح لك بالمشاركة</strong>&nbsp;في خواص وصللي&trade; التفاعلية.</span></li>\r\n	<li><span dir=\"rtl\"><strong>الإبقاء على خدماتنا آمنة</strong>&nbsp;وتحت الحماية اللازمة.</span></li>\r\n	<li><span dir=\"rtl\"><strong>تخصيص وتطوير خدماتنا</strong>&nbsp;بما يتناسب مع احتياجات مستخدمينا، مثل التحديثات والخواص الجديدة، الترشيحات، المحتوى، وسائل التواصل الاجتماعي، الإحالات، والإعلانات.</span></li>\r\n</ol>\r\n\r\n<h2><span dir=\"rtl\">تخزين ونقل البيانات الشخصية</span></h2>\r\n\r\n<ol>\r\n	<li><span dir=\"rtl\">باستخدامك لتطبيقات وصللي&trade;&nbsp;أو خدماتها، أنت توافق على أن نمتلك الحق في نقل بياناتك الشخصية المبينة في سياسة الخصوصية، وحفظها لدينا. والتي قد يكون بعضها أقل في درجة الحماية من نظم الحماية المتبعة في منطقة إقامتك. في هذه الحالة سنقوم باتخاذ التدابير اللازمة لحماية بياناتك الشخصية وقفًا لسياسة الخصوصية هنا. بمشاركة البيانات الشخصية لك معنا، فأنت توافق على أي إجراءات نقل، تخزين، أو معالجة نقوم بها على هذه البيانات، وأنك تعطي لوصللي&trade; الحق في التحكم في هذه البيانات. من جانبنا نضمن اتخاذ كافة الخطوات اللازمة والمتعارف عليها لضمان معالجة آمنة لبياناتك وفقًا لسياسة الخصوصية الموافق عليها.</span></li>\r\n	<li><span dir=\"rtl\">إذا تطلب الأمر وفقا للقوانين أو فى حالة طلبك شخصيًا من شركة وصللي&trade;، يمكننا مسح بياناتك الشخصية أو تجنيبها.</span></li>\r\n	<li><span dir=\"rtl\">للحفاظ علي سلامة قواعد البيانات الخاصة بنا، لنقدم خدماتنا باستمرار، ولأغراض البحث وتحليل البيانات، ولضمان الإمتثال للقوانين، نحن نحتفظ بالبيانات الشخصية والمعلومات الديموغرافية المقدمة بواسطة المستخدمين وسائقي المركبات لفترة طويلة من الوقت. لن يكون وصللي&trade; مسئولاً&nbsp;عن دقة البيانات التي تقدمها، وستقوم بتعديل وتحديث بياناتك الشخصية في قواعد البيانات الخاصة بنا بناء علي طلبك.</span></li>\r\n	<li><span dir=\"rtl\">سنقوم بمسح أو أرشفة بياناتك الشخصية من الإستخدام النشط إذا طلب ذلك بمقتضي قانون معين أو بطلب منك.</span></li>\r\n	<li><span dir=\"rtl\">للدخول أو الوصول الي الخدمات فإنك بموجب هذه السياسة تضمن وتتعهد بأنك تفهم أن جميع البيانات المقدمة منك من خلال تطبيق وصللي&trade; أو غيرها، يمكن إستخدامها بواسطة وصللي&trade;، وفقا للقوانين المطبقة وسياسة الخصوصية والشروط والأحكام.</span></li>\r\n</ol>\r\n\r\n<h2><span dir=\"rtl\">&nbsp;مشاركة البيانات الشخصية</span></h2>\r\n\r\n<p><span dir=\"rtl\">ربما نقوم بمشاركة البيانات الشخصية التي نجمعها عنك كما هو موضح في هذا البيان&nbsp;أو كما هو موضح في وقت جمع المعلومات أو مشاركتها، يشمل ذلك مشاركتها مع:</span></p>\r\n\r\n<ol>\r\n	<li><span dir=\"rtl\"><strong>السائقين:</strong>&nbsp;لكى نمكنهم من تقديم الخدمات التى تطلبها. على سبيل المثال نقوم بمشاركة اسمك ومواقع الأستلام والتسليم مع سائقي المركبات.</span></li>\r\n	<li><span dir=\"rtl\"><strong>أطراف ثالثة شريكة:</strong>&nbsp;لتقديم خدمة قمتم بطلبها من خلال شراكة أو عرض ترويجى مقدم بواسطة طرف ثالث من خلال تطبيق وصللي&trade; أو خدماتها.</span></li>\r\n	<li><span dir=\"rtl\"><strong>اطراف ثالثة أخرى:</strong>&nbsp;على سبيل المثال تطبيقات أو مواقع أخرى تندمج مع (API) أو الخدمات الخاصة بنا او الأطراف ممن لديهم (API) أو خدمات يرغب وصللي&trade; فى التعاون معهم.</span></li>\r\n	<li><span dir=\"rtl\">المؤسسة أو&nbsp;<strong>جهة العمل</strong>&nbsp;التى تعمل بها.</span></li>\r\n</ol>\r\n\r\n<h2><span dir=\"rtl\">&nbsp;إضافة أخرى هامة</span></h2>\r\n\r\n<p><span dir=\"rtl\">يمكننا مشاركة البيانات الشخصية الخاصة بك:</span></p>\r\n\r\n<ol>\r\n	<li><span dir=\"rtl\">مع الكيانات التابعة والفرعية لوصللي&trade;.</span></li>\r\n	<li><span dir=\"rtl\">مع الوكلاء والاستشارين وشركاء التسويق والإعلان ومزودى خدمات آخرين ممن يحتاجون الوصول إلى البيانات الشخصية لأداء عملهم نيابة عنا أو لتنفيذ أى عقد نبرمه معهم.</span></li>\r\n	<li><span dir=\"rtl\">استجابة لطلب أى معلومات بواسطة سلطة مختصة أوبمقتضى أى قانون أو لائحة تنظيمية أو إجراء قانونى معمول به.</span></li>\r\n	<li><span dir=\"rtl\">مع الجهات المسؤولة المكلفة بتنفيذ القانون والسلطات الحكومية أو أطراف ثالثة أخرى لتنفيذ أو تطبيق الشروط والأحكام الخاصة بنا وللتحقيق في انتهاكات محتملة أو إذا كنا نرى بأن أعمالكم كانت مخالفة لشروط وأحكام خدماتنا أو لحماية الحقوق والممتلكات وأمان وصللي&trade; أو غيره.</span></li>\r\n	<li><span dir=\"rtl\">مع شركات أخرى أو أطراف ثالثة فيما يخص أو خلال المفاوضات بشأن أى عملية اندماج أو بيع لأصول الشركة، إعادة هيكلة، تمويل، أو شراء حصة أو كامل شركتنا، بواسطة أى شركة أخرى.</span></li>\r\n</ol>\r\n\r\n<h1><strong><span dir=\"rtl\">خياراتك المتاحة</span></strong></h1>\r\n\r\n<ol>\r\n	<li>\r\n	<h3><span dir=\"rtl\"><strong>التسويق وخيار الرفض</strong></span></h3>\r\n\r\n	<p><span dir=\"rtl\">يمنح وصللي&trade; المستخدمين وسائقي المركبات الفرصة لاختيار رفض الاتصالات من طرفنا أو من شركائنا فيمت يخص طلب المعلومات حول المستخدم. يكون لك في هذه الحالة الحق في رفض استخدام بياناتك الشخصية لأغراض التسويق، و/أو حذفها من قاعدة البيانات.</span></p>\r\n	</li>\r\n	<li>\r\n	<h3><span dir=\"rtl\"><strong><strong>التغييرات في سياسة الخصوصية</strong></strong></span></h3>\r\n\r\n	<p><span dir=\"rtl\">يمكننا إجراء أي تعديلات أو تغييرات على سياسة الخصوصية من حين لأخر. إذا قمنا بأى تغييرات جوهرية، تخص كيفية التعامل مع بياناتك الشخصية،&nbsp;وسنقوم بإشعارك من خلال خدماتنا، أو بواسطة أي وسائل أخرى مثل البريد الإليكتروني، الرسائل القصيرة. ويعد استمرارك في استخدام خدماتنا موافقة على تلك الإضافات أو التغييرات.</span></p>\r\n	</li>\r\n	<li>\r\n	<h3><span dir=\"rtl\"><strong>خصائص المشاركة على مواقع التواصل الاجتماعي</strong></span></h3>\r\n\r\n	<p><span dir=\"rtl\">قد تتصل خدماتنا مع خصائص المشاركة الاجتماعية، وغيرها من الأدوات ذات الصلة التي تتيح لك مشاركة الإجراءات التي تقوم بها على تطبيق وصللي&trade; أو غيره من خدماتنا، مع تطبيقات أو مواقع التواصل الاجتماعي وغيرها، والعكس. يمكننا استخدام هذه البيانات التي تشاركها مع أصدقائك أو على المشاع، وفقًا للإعدادات التي اخترتها مع خدمة المشاركة الاجتماعية. يرجى الرجوع إلى سياسات الخصوصية الخاصة بخدمات المشاركة الاجتماعية لمعرفة كيفية معالجة البيانات التي تشاركها معهم أو من خلالهم.</span></p>\r\n	</li>\r\n	<li>\r\n	<h3><span dir=\"rtl\"><strong>تحليل البيانات والخدمات التي يقدمها الآخرون</strong></span></h3>\r\n\r\n	<p><span dir=\"rtl\">قد نسمح لآخرين، جهات أو أشخاص، بتقديم خدمات قياس وتحليل للجمهور نيابة عنا، أو القيام بأعمال دعاية لصالحنا عبر الإنترنت، أو تتبع ورفع تقارير حول أداء إعلاناتنا. وقد تستخدم تلك الكيانات ملفات تعريف ارتباط، وحزم تطوير البرمجيات وغيرها من التقنيات لتحديد هوية جهازك عند زيارتك لموقعنا واستخدامك لخدماتنا، كذا عند زيارتك لمواقع وخدمات إلكترونية أخرى للحصول على معلومات أخرى بشأن هذه التقنيات أو موفرى الخدمات، يًرجى الرجوع إلى فقرة ملفات تعريف الأرتباط الخاص بنا.</span></p>\r\n	</li>\r\n</ol>\r\n\r\n<h1><span dir=\"rtl\"><strong>اختياراتك</strong></span></h1>\r\n\r\n<ol>\r\n	<li>\r\n	<h2><span dir=\"rtl\">معلومات الحساب</span></h2>\r\n\r\n	<ol>\r\n		<li>\r\n		<p><span dir=\"rtl\">يمكنك تصحيح معلومات حسابك فى أى وقت من خلال تسجيل الدخول إلى حسابك على الانترنت أو حسابك على التطبيق. إذا كنت تريد إلغاء حسابك، يُرجى مراسلتنا بالبريد الإلكترونى على info@wassalley.com. يُرجى ملاحظة أننا فى بعض الحالات قد نحتفظ بمعلومات محددة عنك بحسب ما ينص عليه القانون، أو لأغراض تجارية مشروعة إلى الحد الذى يجيزه القانون، على سبيل المثال: إذا كان لديك بطاقة ائتمان أو دين قائم على حسابك، أو كنت قد ارتكبت جريمة احتيال أو انتهاك لشروط وأحكام الاستخدام، فقد نطلب منك الوصول لحل قبل حذف معلوماتك لدينا.</span></p>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n	<li>\r\n	<h2><span dir=\"rtl\">حقوق التواصل</span></h2>\r\n\r\n	<ol>\r\n		<li>\r\n		<p><span dir=\"rtl\">تلتزم شركة وصللي&trade; بطلبات الأفراد فيما يتعلق بالوصول، التصحيح، أو حذف بياناتهم الشخصية التي قامت بتخزينها وجمعها وفقًا للقانون القائم.</span></p>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n	<li>\r\n	<h2><span dir=\"rtl\">احتياطات الأمان الرقمي</span></h2>\r\n\r\n	<ol>\r\n		<li>\r\n		<p><span dir=\"rtl\">ملفك الشخصى لدى وصللي&trade; محمى بكلمة مرور بحيث يكون فقط لك الحق ولموظفى وصللي&trade; المخولين فى الوصول إلى معلومات حسابك.بالتالي لن يبادر أي من موظفين وصللي&trade; بالاتصال أو التواصل معك لطلب بيانات حسابك، بما في ذلك كلمة السر.</span></p>\r\n		</li>\r\n		<li>\r\n		<p><span dir=\"rtl\">يبذل وصللي&trade; كل جهد مستطاع لضمان أمان وحماية بياناتك الشخصية. لدينا فريق مختص ومخصص للحفاظ على سياسة الخصوصية المنصوص عليها هنا، وهم مسؤولون عن أي مراجعات دورية، مبادرات لزيادة حماية البيانات، والمراجعات الدورية لأمن الويب، والتأكد من أن كل موظف لدينا على علم ويدرك الممارسات الآمنة لحماية بياناتك. لكن للأسف لا يمكن ضمان حماية أي بيانات منقولة عبر الإنترنت بنسبة 100%، لذلك لا يمكن ضمان أمان أي بيانات شخصية تنقلها أو ترسلها، وبذلك أنت تأخذ على عاتقك حماية بياناتك. إن كان لديك أي استفسار حول هذه المسألة، يمكنك الرجوع إلى شروط وأحكام الاستخدام، والمحكومة بالقانون المطبق محليًا.وعلى ذلك تخلى شركة وصللي&trade; مسؤوليتها صراحة ضد أي مطالبات أو مساءلات قد تنشأ في حال حصول أي طرف من الأطراف على بيانات الشخصية التي تشاركها مع وصللي&trade; عبر التطبيق أو عبر أي من خدماتنا.</span></p>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1><span dir=\"rtl\"><strong>ملف تعريف الأرتباط</strong></span></h1>\r\n\r\n<ol>\r\n	<li>\r\n	<p><span dir=\"rtl\">يستخدم موقعنا الإليكتروني ملفات تعريف ارتباط تميزك عن المستخدمين الأخرين. هذا يساعدنا فى أن نقدم لك تجربة جيدة عندما تتصفح الموقع، ويسمح لنا أيضًا بتحسينه وتطوير الخدمات التى نقدمها. من خلال زيارتك لموقعنا الإليكتروني، وتصفحه، فأنت توافق على استخدامنا لملفات تعريف الارتباط.</span></p>\r\n	</li>\r\n</ol>\r\n\r\n<h1><span dir=\"rtl\"><strong>اتصل بنا</strong></span></h1>\r\n\r\n<ol>\r\n	<li>إذا كان لديك أى استفسارات، ملاحظات، طلبات متعلقة بسياسة الخصوصية، و ملاحظات او طلبات متعلقة ببيان الخصوصية، أو كان لديك أي شكاوي، اعتراضات، أو اقتراحات فيما يخص معالجة بياناتك الشخصية، يمكنك التواصل معنا على بريدنا الإليكتروني: info@wassalley.com</li>\r\n</ol>\r\n\r\n<p><span dir=\"rtl\">&nbsp;</span></p>', NULL, '2022-01-18 19:17:59'),
(40, 'about_us', '<p><img alt=\"وصللي™ wassalley™\" src=\"http://wassalley.com/storage/app/public/restaurant/2022-01-14-61e1ef09e41bd.png\" style=\"height:420px; width:420px\" /></p>\r\n\r\n<p>وصللي&trade; تهدف إلى ربط الطعام ؛ الناس ؛ الثقافات والترفيه في مكان واحد .</p>\r\n\r\n<p>تم تأسيس وصللي&trade;&nbsp;بهدف تنمية الأعمال التجارية المحلية ودعمها ،مع تقديم الطعام العالمي المفضل لديك والوجبات السريعة مباشرة إلى باب منزلك .<br />\r\n<br />\r\nمع مجموعة مميزة من المطاعم على تطبيقنا و واجهة سهلة الاستخدام و ممتعة للغاية</p>\r\n\r\n<p>وصللي&trade; هو البوابة إلى عالم من السعادة من خلال شركائنا و التسليم في الوقت المحدد ، نسعى جاهدين لجعل وصللي&trade; مكان يحطم توقعات ذوق كالمعتاد واكتشاف كل ما هو جديد، لهذا السبب وصللي&trade; هوالجديد</p>\r\n\r\n<p>وصللي&trade; هوالمكان الذي يوصلك الى تذوق جميع الطعام والوجبات الشهيرة في كل ركن من أركان الكرة<br />\r\nالأرضية بلمسة واحدة&hellip; ربما اثنتان.<br />\r\n<br />\r\nيتكون فريقنا من عشاق للطعام المتحمسين الذين يعملون بلا كلل لجعل وصللي&trade; تطبيق فريد&nbsp;من نوعه&nbsp;على الإنترنت للطعام والمنتجات الغذائية وأكثر.</p>', NULL, '2022-01-18 19:20:46'),
